import { StatusBar } from "expo-status-bar";
import React from "react";
import { StyleSheet, View, Image } from "react-native";
import styled from "styled-components/native";
import { Button } from "react-native-elements";

import { MaterialIcons } from "@expo/vector-icons";
import { Input } from "react-native-elements";

const Container = styled.View`
  flex: 1;
  background-color: #fff;
  justify-content: center;
  align-items: center;
`;

const Logo = styled.Image`
  width: 150px;
  height: 88px;
  margin-bottom: 20px;
`;

const Text = styled.Text`
  font-family: BMHANNA;
  font-size: 18px;
  margint-top: 20px;
`;

const styles = StyleSheet.create({
  inputContainer: {
    width: 270,
  },
  button: {
    backgroundColor: "#03bcdb",
    borderWidth: 2,
    borderColor: "#03bcdb",
    borderRadius: 6,
  },
  buttonContainer: {
    marginTop: 10,
    height: 60,
    width: 183,
  },
  title: { fontWeight: "bold" },
});

export default function SingIn() {
  return (
    <Container>
      <Logo source={require("../../assets/logo.gif")} />
      <Input
        label="이메일"
        containerStyle={styles.inputContainer}
        inputStyle={styles.input}
        placeholder="email@address.com"
        leftIcon={<MaterialIcons name="email" size={24} color="#03bcdb" />}
      />
      <Input
        containerStyle={styles.inputContainer}
        label="비밀번호"
        placeholder="Password"
        secureTextEntry={true}
        leftIcon={<MaterialIcons name="lock" size={24} color="#03bcdb" />}
      />
      <Button
        title="로그인"
        buttonStyle={styles.button}
        containerStyle={styles.buttonContainer}
        titleStyle={styles.title}
      />
      <Image source={require("../../assets/kakao_login.png")} />
      <Text>아이디 / 비밀번호 찾기</Text>
      <Text>회원가입</Text>
      <StatusBar barStyle="light-content" />
    </Container>
  );
}
